import React from 'react';

import axios from "axios";

import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import Card from 'react-bootstrap/Card';

import 'bootstrap/dist/css/bootstrap.min.css';

import NavBar from '../navbar/NavBar';

import './home.css';

class Home extends React.Component {
  constructor(){
    super();
    this.state = {
      students : []
    }
  }
  componentDidMount() {
    axios.get("http://127.0.0.1:8000/students/")

  }
  render(){
    return (

      <div className="Home">    
        <NavBar />
        <main className="Home-main ">  

          <header className="Home-header">
          <h1>
          COMPREHENSIVE STUDENTS AND COURSES STATS
         </h1>
          </header>

          <section className="Form-container pt-5">   
          <Form  inline>
            <FormControl  className="form-control" type="text" placeholder="Search..." className="" />
          </Form>
          </section>

          <section className="Info-container">
                <Card lassName="text-center" style={{ width: '18rem' }}>
                  <Card.Img variant="center" src="" />
                  <Card.Body>
                    <Card.Title>Card Title</Card.Title>
                    <Card.Text>
                      Some quick example text to build on the card title and make up the bulk of
                      the card's content.
                    </Card.Text>                    
                  </Card.Body>
                  </Card>
          </section>
        </main>
      </div>
    );
  }

}

export default Home;
